import React from "react";
import { Link, Outlet } from "react-router-dom";
const MarktingPlugin = () => {
  return (
    <div>
      <Link to="/home/smart/userPortrait">用户画像</Link>
      <Link to="/home/smart/inventoryManage">库存管理</Link>

      <Outlet />
    </div>
  );
};
export default MarktingPlugin;
